import React from 'react'

function Row() {
  return (
    <div className='row'>
      <h1>Trending Now</h1>
      <div className="row_posters">
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fhelp.netflix.com%2Fen%2Fnode%2F412&psig=AOvVaw2PfFdG1mMpJb9B5BU_VDuk&ust=1670754454413000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCKixusDr7vsCFQAAAAAdAAAAABAE" alt="" />
      </div>
    </div>
  )
}

export default Row
